import React from 'react';
import Header from '../Header/Header';

const Profile: React.FC = () => {
    return (
      <div>
      <Header/>
      <div>
        <div className='hello'>
            <div id='hello'>Ваш профіль:</div>
        </div>

        <div>
          <table>
            <tr>
              <td>12345</td>
              <td>213123</td>
            </tr>
            <tr>
              <td>gdrg</td>
            </tr>
          </table>
        </div>
      </div>
      </div>
    );
  };

export default Profile;
